import React,{Fragment, useState} from 'react'
import {Box,Grid,Paper,ImageList,ImageListItem  } from '@mui/material'
import logo1 from '../../../img/eicblanco.png'
import logo2 from '../../../img/ucn400x112.png'
const HeaderHome = () => {
    const stylelogo1 = {
        width: '100%',
        
    };
    const stylelogo2 = {
        width: '100%',
        margin:2
     
    };
  //COMPONENTE HEADER DEL HOMEPAGE
  return (
    <Fragment>
    <Box sx={{ flexGrow: 1 }}>
        <Grid container spacing={1} >
            <Grid 
                item xs={12} md={6}
            >
            <div className="logo1">
            <img 
                src={logo2}
                alt="logo 2"
                style={stylelogo1}
            />
            </div>
            
            </Grid>
            <Grid
            item xs={12} md={6}
            >
            <div className="logo2">
            <img 
                src={logo1}
                alt="logo 1"
                style={stylelogo2}
            />
            </div>
            </Grid>
        </Grid>
    </Box>
   
    </Fragment>
  )
}

export default HeaderHome
